import HlavnaStranka from "./HlavnaStranka";
import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import MainImg from './Komponenty/HlavnaStranka/MainImg';

const App = () => {

    return(
        <Router>
      <Switch>
        <Route path="/vyhladavanie" component={MainImg} />
        <Route path="/" component={HlavnaStranka} />
      </Switch>
    </Router>
    )
}

export default App;
